import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const StyledTableCell = withStyles((theme) => ({
  head: {

    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,

  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.background.default,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('A', 'A1', 'B1', 'C1','D1'),
  createData('B', 'A2', 'B2', 'C2', 'D2'),
  createData('C', 'A3', 'B3', 'C3', 'D3'),
  createData('D', 'A4', 'B4', 'C4', 'D4'),
  createData('E', 'A5', 'B5', 'C5', 'D5'),
];

const useStyles = makeStyles({
  table: {
    minWidth: 700,
    marginTop: "40px",
    marginRight: "500px",
    padding:"30px",
    fontSize: 20,
  },

  TableCell:{
    fontSize: 20,
  }
});

export default function CustomizedTables() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
        <StyledTableCell align="right" colSpan={2}>
              GESTION DE VEHICULOS
            </StyledTableCell>
          <TableRow>
            <StyledTableCell>ESPACIOS</StyledTableCell>
            <StyledTableCell align="center">A</StyledTableCell>
            <StyledTableCell align="center">B</StyledTableCell>
            <StyledTableCell align="center">C</StyledTableCell>
            <StyledTableCell align="center">D</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="center">{row.calories}</StyledTableCell>
              <StyledTableCell align="center">{row.fat}</StyledTableCell>
              <StyledTableCell align="center">{row.carbs}</StyledTableCell>
              <StyledTableCell align="center">{row.protein}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
